    constructor(props) {
        super(props);
        this.state = {
            layer1: true,
            layer2: true,
            layer3: true,
            merchantsRoads: true,
            imperialsRoads: true,
            shrines: true,
            villages: true,
            towers: true,
            cities: true,
            castles: true
        };
        this.oldX = 0;
        this.oldY = 0;
        this.newX = 0;
        this.newY = 0;
        this.zoom = 1;
        this.activeBubble = false;
    }

    moveMap(e)
    {
        let svg = document.querySelector('#Rokugan_Map');
        let maxHeight = -1200 + svg.parentElement.parentElement.offsetHeight;

        this.newX = e.clientX;
        this.newY = e.clientY;

        //let diffX = this.newX - this.oldX;
        let diffY = (this.newY - this.oldY) / 10;

        if (maxHeight < (parseInt(svg.style.top) + diffY) && (parseInt(svg.style.top) + diffY) < 0)
        {
            svg.style.top = (parseInt(svg.style.top) + diffY)+'px';
        }
    }

