                             let maxHeight = -(1200 * this.zoom) + svg.parentElement.parentElement.offsetHeight;
                             let maxWidth = -(1200 * this.zoom) + svg.parentElement.parentElement.offsetWidth;

                             this.newX = e.clientX;
                             this.newY = e.clientY;

                             let diffX = (this.newX - this.oldX) / 10;
                             let diffY = (this.newY - this.oldY) / 10;

